import logo from './logo.svg';
import './App.css';
import AppOne from './LecturesMarksPage';
import MarksAdd from './MarksAddPage';
import MarksEdit from './MarkEditPage';
import ResultView from './ResultViewPage';
import GPA from './GpaPage';
import StuMedicalView from './StuMedicalViewPage';
import StuMedicalUplaodPage from './StuMedicalUplaodPage';
import ExaDeMedicalViewPage from './ExaDeMedicalViewPage';
import StuAdmisRequViewPage from './StuAdmisRequViewPage';
import StuAdmisRequApplPage from './StuAdmisRequApplPage';
import ExaDeAdmisRequViewPage from './ExaDeAdmisRequViewPage';
import ExaDeAdmisRequAddPage from './ExaDeAdmisRequAddPage';
import StuManagepage from './StuManagepage';
import StuManageAddPage from './StuManageAddPage';
import LecManagementPage from './LecManagementPage';

const App = () => {
  return (
    <div className="App">
      <h1>MARK PAGE</h1>
<AppOne/>
<h1>MARK ADD PAGE</h1>
<MarksAdd />
<h1>MARK EDIT PAGE</h1>
<MarksEdit />
<h1>RESULT VIEW PAGE</h1>
<ResultView />
<h1>GPA PAGE</h1>
<GPA />
<h1>STUDENT MEDICAL VIEW PAGE</h1>
<StuMedicalView />
<h1>STUDENT MEDICAL UPLOAD PAGE</h1>
<StuMedicalUplaodPage />
<h1>EXAM DEPARTMENT MEDICAL VIEW PAGE</h1>
<ExaDeMedicalViewPage /> 

<h1>STUDENT ADMISSION REQUEST VIEW PAGE</h1>
<StuAdmisRequViewPage />

<h1>STUDENT ADMISSION REQUEST APPly PAGE</h1>
<StuAdmisRequApplPage />

<h1>EXAM DEPARTMENT ADMISSION REQUEST VIEW PAGE</h1>
<ExaDeAdmisRequViewPage />

<h1>EXAM DEPARTMENT ADMISSION REQUEST ADD PAGE</h1>
<ExaDeAdmisRequAddPage />

<h1>STUDENT MANAGE PAGE</h1>
<StuManagepage />

<h1>STUDENT MANAGE ADD PAGE</h1>
<StuManageAddPage />

<h1>LECTURE MANAGEMENT PAGE</h1>
<LecManagementPage />
</div>
  );
}

export default App;
